const Hello = (props) => {
  return (
    <p>Hello {props.name}</p>
  )
}
const App = () => {
  console.log('Hello from App');
  const now = new Date();

  return (<div>
    <Hello name='Louis' />
    <Hello name='Elliot' />
    <p>it is now {now.toString()}</p>
  </div>
  )
}


export default App;
